 To calculate the full name from the given first and last name, you can use the following TypeScript function:
```typescript
function getFullName(firstName: string, lastName: string): string {
  return `${firstName} ${lastName}`;
}
```
This function takes the input parameters as strings and concatenates them using the `" "` space as a separator. The resulting string will be the full name of the person.
